import React from "react";
import { Icon, CloseIcon, SidebarContainer } from "./SidebarElement";

const Sidebar = () => {
  return (
    <SidebarContainer>
      <Icon>
        <CloseIcon />
      </Icon>
      <SidebarWrapper>
        <SidebarMenu>
          <SidebarLink to="about">About Me</SidebarLink>
        </SidebarMenu>
        <SidebarMenu>
          <SidebarLink to="about">About Me</SidebarLink>
        </SidebarMenu>
        <SidebarMenu>
          <SidebarLink to="about">About Me</SidebarLink>
        </SidebarMenu>
      </SidebarWrapper>
    </SidebarContainer>
  );
};
export default Sidebar;
